import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import 'react-native-gesture-handler';
import { useFonts } from 'expo-font';
import Constants from 'expo-constants';
import Home from './pages/Home';
import Email from './pages/Email';

const Stack = createStackNavigator();

export default function App() {

  const [fontsLoaded] = useFonts({
    'Arial': require('./assets/fonts/Arial.ttf'),
    'QsBold': require('./assets/fonts/QsBold.ttf'),
    'QsLight': require('./assets/fonts/QsLight.ttf'),
    'QsMedium': require('./assets/fonts/QsMedium.ttf'),
    'QsRegular': require('./assets/fonts/QsRegular.ttf'),
    'QsSemiBold': require('./assets/fonts/QsSemiBold.ttf'),
    'AssistantMedium': require('./assets/fonts/AssistantMedium.ttf'),
    'AssistantBold': require('./assets/fonts/AssistantBold.ttf'),
    'AssistantXBold': require('./assets/fonts/AssistantXBold.ttf'),
    'AssistantXBold': require('./assets/fonts/AssistantLight.ttf'),
    'QsRegular': require('./assets/fonts/QsRegular.ttf'),
    'QsSemiBold': require('./assets/fonts/QsSemiBold.ttf'),
    'OSLight': require('./assets/fonts/OSLight.ttf'),
  });


  if (!fontsLoaded) {
    return null;
  } else
  return (
    <NavigationContainer style={styles.container}>
      <StatusBar/>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={Home} options={{headerShown: false}}/>
        <Stack.Screen name="Email" component={Email} options={{headerTitle:'', headerShadowVisible: false}}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: Constants.statusBarHeight
  },
});
